import React from "react";
import logo from "../assets/logo.png";

function Header() {
  return (
    <div className="glass w-full max-w-4xl flex items-center justify-between p-6">
      <img src={logo} alt="Logo" className="w-12 h-12" />
      <h1 className="text-2xl font-semibold tracking-wider">TrendAI</h1>
    </div>
  );
}

export default Header;
